import React from 'react'
import "./feature.css"

const Feature = ({name, title}) => {
  return (
    <div className="gpt3_section-features">
    <div>
      <h1 className='gpt3_features'>{name}</h1>
      <p className='gpt3_text'>{title}</p>
    </div>
    </div>
  )
}

export default Feature
